import React from 'react';
import './Projects.css';
import project1 from '../assets/Project1.png';
import project2 from '../assets/Project2.png';
import project3 from '../assets/Project3.png';

function Projects() {
    const projectData = [
        {
            title: 'Basic Age Calculator',
            image: project1,
            livelink: 'https://youragecalculator.com',
            description: 'A clean, responsive web app that calculates your exact age in years, months, and days based on your date of birth. It includes a light/dark mode toggle.',
            caseStudy: '1. '
        },
        {
            title: 'Calculator with basic calculations',
            image: project2,
            livelink: 'https://yourcalculator.com',
            description: 'A simple calculator which can perform basic calculations like addition, subtraction, multiplication, division.',
            caseStudy: 'The challenge was to perform the backspace action, which is resolved by using slice function in it.'
        },
        {
            title: 'A Number guessing game',
            image: project3,
            livelink: 'https://yournumberguessiggame.com',
            description: 'A personal website showcasing my skills, resume, and contact details.',
            caseStudy: 'The challenges was persisting data between sessions, which I resolved using localStorage and useEffect.'
        }
    ];

    return(
        <section className="projects">
            <h2>Projects & Work samples</h2>
            <p className='projects-intro'>
                Here are some projects I've built to strengthen my frontend skills and turn ideas into interactive web experiences. Each project taught me valuable lessons in coding, debugging, and responsive design.
            </p>
            <div className='project-grid'>
                {projectData.map((project, index) => (
                    <div className='project-card' key={index}>
                        <img src={project.image} alt={project.title} className='project-img' />
                        <div className='project-content'>
                            <h3>{project.title}</h3>
                            <p>{project.description}</p>
                            <p className='case-study'><strong>Case Study: </strong>{project.caseStudy}</p>
                            <a href={project.livelink} target="_blank" rel="noopener noreferrer" className='project-link'>
                                View Live --&gt;
                            </a>
                        </div>
                    </div>
                ))}
            </div>
        </section>
    );
}

export default Projects;
